import React from 'react';

function Lilisting(props){
    const {name, age, location, number} = props.val;
    return(
        <>
        Name: <strong>{name}</strong> 
        Name: {age} 
        Name: {location} 
        {number}
        </>
    )
}

export default Lilisting
